const Detail = () => {
  return (
    <div>
      <div className="header header__detail">
          <Header></Header>
          <NavBar></NavBar>
      </div>
      <div className="detail__content">
        <Contents></Contents>
      </div>
      <div className="footer">
        <Footer></Footer>
      </div>
    </div>
  );
};

export default Detail;
//======================
import { Header,NavBar,Footer } from "../home/Home";
import "./dist/detail.css"
import listDetails from "../../data/detail.json"
//=====================
const Contents =()=>{
  console.log(listDetails)
  return(
    <div>
      <RenderDatail
          name={listDetails.name}
          address={listDetails.address}
          distance={listDetails.distance}
          price={listDetails.price}
          photos={listDetails.photos}
          title={listDetails.title}
          description={listDetails.description}
          nine_night_price={listDetails.nine_night_price}
      ></RenderDatail>

    </div>
  )
}
//==========================
const RenderDatail =(props)=>{
  return(
    <div>
      <div className="col">
        <h4>{props.name}</h4>
        <div>
          <i className="fa-solid fa-location-dot"></i>
          <p>{props.address}</p>
        </div>
        <p>{props.distance}</p>
        <p>{props.price}</p>
      </div>
      <div className="col">
        <button>Rever</button>
      </div>
    </div>
  )
}
